import React from "react";
import "./Sidebar.css";
import SidebarRow from "./SidebarRow.js";
import HomeIcon from "@material-ui/icons/Home";
import WhatShotIcon from "@material-ui/icons/Whatshot";
import SubscriptionsIcon from "@material-ui/icons/Subscriptions";

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>I am a side bar</h2>
      {/* below is props -- meaning using the same component with different properties */}
      {/* capital I in Icon was needed so that react knows that this is a component passing */}
      <SidebarRow selected="true" Icon={HomeIcon} title="Home" />
      <SidebarRow Icon={WhatShotIcon} title="Trending" />
      <SidebarRow Icon={SubscriptionsIcon} title="Subscription" />
      <hr />
      <SidebarRow title="Library" />
      <SidebarRow title="History" />
      <SidebarRow title="Your Videos" />
      <SidebarRow title="Watch Later" />
      <SidebarRow title="Liked Videos" />
    </div>
  );
}

export default Sidebar;
